/* global BrainBrowser */
/* eslint-disable */

//import {PDFDocument} from '../pdfkit/pdfkit';
import pdfkit from '../pdfkit/pdfkit';
import blobStream from '../pdfkit/blob-stream';

import { Brains } from './brains';

class Download{
 
  downloadPdf(){
    try{
    let doc = new pdfkit();
    //let doc = new PDFDocument;
   // let doc = new PDFDocument({ autoFirstPage: false });

    // # pipe the document to a blob
    let stream = doc.pipe(blobStream());
    //console.log(" BrainBrowser ", BrainBrowser);
    let overlay = BrainBrowser.VolumeViewer.getOverlayVolume();
    //console.log("overlay ",overlay);
    this.coords = overlay.getCurrentVolumeCoords();
    //console.log(" this.coords ", this.coords);
    let scan = BrainBrowser.VolumeViewer.getScanVolume();
    //console.log("scan",scan);
    this.threshold = [scan.intensity_min * 100, scan.intensity_max * 100];
    //console.log("  this.threshold ",  this.threshold);
    this.setCursorColor('rgba(255, 255, 255, 0.0)');

    // Load both fonts
    var xhr = new XMLHttpRequest();
    xhr.open('GET', '/static/fonts/sourceSansPro-Regular.ttf', true);
    xhr.responseType = 'arraybuffer';
    xhr.onload = (e) => {
      if (e.target.status === 200) {
        doc.registerFont('regular', 'Helvetica');
        var xhr2 = new XMLHttpRequest();
        xhr2.open('GET', '/static/fonts/sourceSansPro-Bold.ttf', true);
        xhr2.responseType = 'arraybuffer';
        xhr2.onload = (e) => {
          if (e.target.status === 200) {
            doc.registerFont('bold', xhr2.response);
            this.buildPdf( doc );
            // # get a blob when you're done
            doc.end();
          }
        };
        xhr2.send();

      }
    };

    xhr.send();

    stream.on('finish', () => {
      let blob = stream.toBlob('application/pdf');
      this.autoDownloadPdf(blob);

      this.setCursorColor('#FFFFFF');
    });
  }catch(error){ console.log(" Error when downloading pdf");}
  }

  autoDownloadPdf(blob){
    let brains = new Brains();
    let currentBrain = brains.getCurrentBrain();

    let link = document.createElement('a');
    link.href = window.URL.createObjectURL(blob);
    link.download = currentBrain.name + '.pdf';

		// Firefox fix, https://stackoverflow.com/a/2817464
		HTMLElement.prototype.click = function() {
		 var evt = this.ownerDocument.createEvent('MouseEvents');
		 evt.initMouseEvent('click', true, true, this.ownerDocument.defaultView, 1, 0, 0, 0, 0, false, false, false, false, 0, null);
		 this.dispatchEvent(evt);
		}
		// end Firefox fix

    link.click();
  }

  downloadZip(){
    let brains = new Brains();
    let currentBrain = brains.getCurrentBrain();

    let link = document.createElement('a');
    link.href = brains.getBrainDownloadUrl( currentBrain );
    link.download = currentBrain.name + '.zip';

    // Firefox fix, https://stackoverflow.com/a/2817464
		HTMLElement.prototype.click = function() {
		 var evt = this.ownerDocument.createEvent('MouseEvents');
		 evt.initMouseEvent('click', true, true, this.ownerDocument.defaultView, 1, 0, 0, 0, 0, false, false, false, false, 0, null);
		 this.dispatchEvent(evt);
		}
    // end Firefox fix

    link.click();
  }

  getScreenshotUrl(axis){
    var canvas = document.createElement("canvas");
    var context = canvas.getContext("2d");
    var img = new Image();

    canvas.width = 200;
    canvas.height = 200;
    context.fillRect(0, 0, canvas.width, canvas.height);

    let panel = BrainBrowser.VolumeViewer.getOverlayVolume().display.getPanel(axis);
    context.drawImage(panel.canvas, 0, 0, 200, 200);

    return canvas.toDataURL();
  }

  setCursorColor(color){
    let axises = ['xspace', 'yspace', 'zspace'];
    let overlay = BrainBrowser.VolumeViewer.getOverlayVolume();

    overlay.color_map.cursor_color = color;
    axises.forEach(axis => {
      BrainBrowser.VolumeViewer.getOverlayVolume().display.getPanel(axis).updated = true
    });
  }

  buildPdf(doc){

    doc.addPage({ margins: {
      top: 50,
      bottom: 0,
      left: 50,
      right: 50
    } })
    .fillColor('#6B6B6B')

    .image( Download.logo_data, 50, 50, {
      fit: [120, 120],
      align: 'center'
    } )

    .image( this.getScreenshotUrl('xspace'), 50, 120, {
      fit: [150, 150],
      align: 'center'
    })

    .font('regular')
    .fontSize(16)
    .text('Sagittal = ' + this.coords.x, 230, 120)
    .font('regular')
    .fontSize(16)
    .text('I = ' + this.coords.i, 230, 145)

    .image( this.getScreenshotUrl('yspace'), 50, 290, {
      fit: [150, 150],
      align: 'center'
    })

    .font('regular')
    .fontSize(16)
    .text('Coronal = ' + this.coords.y, 230, 290)

    .font('regular')
    .fontSize(16)
    .text('J = ' + this.coords.j, 230, 315)

    .image( this.getScreenshotUrl('zspace'), 50, 460, {
      fit: [150, 150],
      align: 'center'
    })

    .font('regular')
    .fontSize(16)
    .text('Axial = ' + this.coords.z, 230, 460)

    .font('regular')
    .fontSize(16)
    .text('K = ' + this.coords.k, 230, 485)

    .font('regular')
    .fontSize(12)
    .text('THRESHOLD: ' + (this.threshold[0]/100).toFixed(2) + ' - ' + (this.threshold[1]/100).toFixed(2), 50, 650)

    .font('regular')
    .fontSize(12)
    .text('Sagittal: ' + this.coords.x, 50, 670)

    .font('regular')
    .fontSize(12)
    .text('Coronal: ' + this.coords.y, 50, 690)

    .font('regular')
    .fontSize(12)
    .text('Axial: ' + this.coords.z, 50, 710)

    .font('regular')
    .fontSize(12)
    .text('I: ' + this.coords.i, 150, 670)

    .font('regular')
    .fontSize(12)
    .text('J: ' + this.coords.j, 150, 690)

    .font('regular')
    .fontSize(12)
    .text('K: ' + this.coords.k, 150, 710)

    return doc;
  }

  static logo_data = 'data:image/jpeg;base64,';
}

export { Download };

/* eslint-enable */
